import React, { useEffect } from "react";
import SearchBar from "./SearchBar";
import {useDispatch, useSelector} from 'react-redux';

function Home(){

    const dispatch = useDispatch();
    const getAllDogs = useSelector((state) => state.allDogs);
    console.log('useSelector ->', getAllDogs);


    useEffect(()=>{
        dispatch(getAllDogs)
    })

    return (
        <>
        <div>
            <SearchBar />
        </div>
        
        
        <div>Home</div>
        </>
    )
}

export default Home;
